import React, {useState, useEffect} from "react";

const Tiles = () => {

    const [divObj, setDivObj] = useState({
       item0: <div id="0" className="imgWrapper"><img src={require("../imgs/giyu.png")} alt="giyu.png" /><div className="picName">Giyu</div></div>,
       item1: <div className="imgWrapper"><img src={require("../imgs/gyomei.png")} alt="gyomei.png" /><div className="picName">Gyomei</div></div>,
       item2: <div className="imgWrapper"><img src={require("../imgs/kanao.png")} alt="kanao.png" /><div className="picName">Kanao</div></div>,
       item3: <div className="imgWrapper"><img src={require("../imgs/mitsuri.png")} alt="mitsuri.png" /><div className="picName">Mitsuri</div></div>,
       item4: <div className="imgWrapper"><img src={require("../imgs/muichiro.png")} alt="muichiro.png" /><div className="picName">Muichiro</div></div>,
       item5: <div className="imgWrapper"><img src={require("../imgs/obanai.png")} alt="obanai.png" /><div className="picName">Obanai</div></div>,
       item6: <div id="6" className="imgWrapper"><img src={require("../imgs/sakonji.png")} alt="sakonji.png" /><div className="picName">Sakonji</div></div>,
       item7: <div className="imgWrapper"><img src={require("../imgs/sanemi.png")} alt="sanemi.png" /><div className="picName">Sanemi</div></div>,
       item8: <div className="imgWrapper"><img src={require("../imgs/shinobu.png")} alt="shinobu.png" /><div className="picName">Shinobu</div></div>,
       item9: <div className="imgWrapper"><img src={require("../imgs/tanjiro.png")} alt="tanjiro.png" /><div className="picName">Tanjiro</div></div>,
       item10: <div className="imgWrapper"><img src={require("../imgs/tengen.png")} alt="tengen.png" /><div className="picName">Tengen</div></div>,
       item11: <div className="imgWrapper"><img src={require("../imgs/zenitsu.png")} alt="zenitsu.png" /><div className="picName">Zenitsu</div></div>,
    })


    const [divArray, setDivArray] = useState(Object.values(divObj));



    console.log(divArray)


    const [scoreArray, setScoreArray] = useState([]);        


    function handleClick(event, key) {
        // console.log(e.currentTarget);

        // setScoreArray(scoreArray.push(e.currentTarget));

        // console.log(scoreArray)


        // console.log(Object.keys(scoreArray))

        console.log(event.currentTarget);
        console.log('key:', key);

    };



    function randomizer() {
        console.log('clicked!');

        let copy = [...divArray];
        copy.sort(()=> 0.5 - Math.random());

        setDivArray(copy)

        console.log(copy);

    };


    return (
        <div id="tilesWrapper">
            <div><button type="button" onClick={randomizer}>Randomizer</button></div>
            <div id="tileContainer">

            {divArray.map((element, key) => (
                <div onClick={event => handleClick(event,key)} key={key}>{element}</div>
            ))}

            </div>
        </div>
    )
};


export default Tiles;

